widgets.script:
widget.on("render", function (w, e) {
  e.prefixText = "";
  e.suffixText = "";
  e.selectedColor = "#0E788F"; /*The color of the chosen title*/
  e.fontColor = "#828282"; /*The color of the unchosen titles*/
  e.elementWidth = "103%";
  e.descColor = "#a5a5a5";
  e.parentMarginLeft = "-15px";
  e.height = 32; /* affects the tabber widget default high*/
});

categoryIds = [
  "660dde4d7529970040f126f8",
  "660dde547529970040f126fa",
  "667b2f737529970040f1849e"

];


subcategoryIds = [
  "660dde5a7529970040f126fc",
  "660dde617529970040f126fe",
  "667b2f7d7529970040f184a0"
];


allIds = [
  ...categoryIds,
  ...subcategoryIds,
]


widget.tabs = [
  {
    title: "Categories",
    displayWidgetIds: categoryIds,
    hideWidgetIds: allIds.filter(n => !categoryIds.includes(n)),
  },

  {
    title: "Sub-categories",
    displayWidgetIds: subcategoryIds,
    hideWidgetIds: allIds.filter(n => !subcategoryIds.includes(n)),
  },

];

widget.style.activeTab = widget.tabs.findIndex(el => el.title == "Categories")

